家共同打拼，大家相處一個月，讀本就想哭，但也強調哭戲中還有很多彩蛋，接下來有很多笑點會讓大家耳目一新，值得期待，演員昨晚一起看首播，江祖平自己也看到落淚。";s:13:"vod_play_from";s:6:"gqm3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:15795:"61$https://gaoqing2.gqzyz.com/2018/09/26/wKUWKRRPrfKHQ7ni/playlist.m3u8#62$https://gaoqing2.gqzyz.com/2018/09/27/JhAyrxcojEhSXGC3/playlist.m3u8#63$https://gaoqing2.gqzyz.com/2018/09/28/Rf37Z7kJ8wo8DkGV/playlist.m3u8#64$https://gaoqing2.gqzyz.com/2018/09/29/PWYy8nUIdIsM8KeV/playlist.m3u8#65$https://gaoqing2.gqzyz.com/2018/10/02/KShZDedak3cJ5AAn/playlist.m3u8#66$https://gaoqing2.gqzyz.com/2018/10/03/0DPjhJraY0pWoLg0/playlist.m3u8#67$https://gaoqing2.gqzyz.com/2018/10/04/fz11snmRbSFaWUqq/playlist.m3u8#68$https://gaoqing2.gqzyz.com/2018/10/06/FwrOrxbL6aktpEZU/playlist.m3u8#69$https://gaoqing2.gqzyz.com/2018/10/06/mhr4GmoN14tFgSht/playlist.m3u8#70$https://gaoqing2.gqzyz.com/2018/10/09/g6p2yfDnIt7bRlzE/playlist.m3u8#71$https://gaoqing2.gqzyz.com/2018/10/10/HyAIVrOeXhkSQZCo/playlist.m3u8#72$https://gaoqing2.gqzyz.com/2018/10/11/WPCgcEhi9JE2i2aP/playlist.m3u8#73$https://gaoqing2.gqzyz.com/2018/10/12/nlLgU1LZx0THzdTS/playlist.m3u8#74$https://gaoqing2.gqzyz.com/2018/10/13/oTHWqk9wArhbUPc6/playlist.m3u8#75$https://gaoqing2.gqzyz.com/2018/10/16/m3F8VZR67yardik4/playlist.m3u8#76$https://gaoqing2.gqzyz.com/2018/10/17/qYAncSGFsrEAC2jC/playlist.m3u8#77$https://gaoqing2.gqzyz.com/2018/10/18/26Pwv1K2O48FeIrL/playlist.m3u8#78$https://gaoqing2.gqzyz.com/2018/10/19/x5UikrEB77ne8uOC/playlist.m3u8#79$https://gaoqing2.gqzyz.com/2018/10/20/h3u3vusxKaR6olba/playlist.m3u8#80$https://gaoqing2.gqzyz.com/2018/10/23/v3GcEdKpw972K1CI/playlist.m3u8#81$https://gaoqing2.gqzyz.com/2018/10/24/rMRn3b6BIgOmepDh/playlist.m3u8#82$https://gaoqing2.gqzyz.com/2018/10/25/bs5jAYlRldcMEqaJ/playlist.m3u8#83$https://gaoqing2.gqzyz.com/2018/10/26/IFmShMSW8Hqhkk5I/playlist.m3u8#84$https://gaoqing2.gqzyz.com/2018/10/27/TeZ7WFGWNiXajqFM/playlist.m3u8#85$https://gaoqing2.gqzyz.com/2018/10/30/UU8ZP04LsQhyydxN/playlist.m3u